Description:
In diesem Maedcheninternat geht die Post ab. Anstatt aus verdorbenen Ludern wohlerzogene Maedchen zu machen, praktizieren die Lehrer hier ihre ganz eigene Erziehungsphilosophie. Wenn sich die Girls nicht an die strengen Schulregeln halten, bekommen sie zur Strafe den harten Knueppel des Lehrkoerpers zu spueren, und zwar ganz tief! Auch waehrend der Nachhilfe- und Klavierstunden bringen die Lehrer den jungen, wissbegierigen Maeusen nicht nur den gewohnten Lehrstoff nahe ...

